<H1><A NAME="c4071"></A><SUP></SUP>Compiler Warning (level 2) C4071</H1>

<P class=dt><B>'function' : no function prototype given</B></P>

<P>The given function was called before the compiler found the corresponding function prototype.</P>

<P>The function will be called using the default rules for calling a function without a prototype.</P>
